import './App.css';
import React from 'react';

function App(){
  return(
    <div className='App'>
      <h1>Hadoop Project</h1>
      <div>
        <label>
          <input
              type='text'
              placeholder='255 characters'
              />
        </label>
        
      </div>
    </div>

  )
}

export default App
